module.exports={de:["In einer komplexen Welt entwickeln wir einfache und intelligente Lösungen.","Wir gestalten Marken & Räume von URL bis IRL.","Manchmal geht es darum den Mut zu haben sich unbeliebt zu machen.","Jedes Projekt hat seine Persönlichkeit, und es liegt an uns, diese zu gestalten.","Verwechsel niemals Tools mit Strategien.","Taten sagen mehr als Worte."],en:["In a complex world, we develop simple and intelligent solutions.","We design Brands & Spaces from URL to IRL.","Sometimes it’s about having the guts to have yourself be unpopular.","Every project has a personality, and it is up to us to create it.","Never confuse tools with strategies.","Action speaks louder than words."]};